import React from "react";
import TinderCard from 'react-tinder-card';
import './TinderCards.css';
function TinderCards() {
    //Hooks are functions that can be used in React Components.
    const [cartoons,setCartoons]=React.useState([
        {
            name:'Shinchan',
            url:'data:image/jpeg;base64,'
        },
        {
            name:'Chota Bheem',
            url:'data:image/jpeg;base64,'
        },
        {
            name:'Doraemon',
            url:'data:image/jpeg;base64,' },
        {

            name:'Dora',
            url:'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRUk0aQfBsQGQgAd4lEEYnhv0wBEkgisCMGrA&usqp=CAU'
        }
    ]);
  return (
    <div className="card-container">
        {
             cartoons.map(cartoon => (
               <TinderCard className="swipe" 
                 key={cartoon.name}
                preventSwipe={['up','down']} >
                   <div
                   style={{backgroundImage: `url(${cartoon.url})`}} className='card'>
                      <h2 className="cartoonName">{cartoon.name}</h2>
                     </div>
                 </TinderCard>
               ))
        }
    </div>
  )
}
export default TinderCards